import Cocoa

var input1 = """

"""
var input = Array(input1.trimmingCharacters(in: .whitespacesAndNewlines))

extension Character {
    func reactsWith(_ other: Character) -> Bool {
        return abs(Int(self.unicodeScalars.first!.value) - Int(other.unicodeScalars.first!.value)) == 32
    }
}

func polymer(_ input: [String.Element]) -> Int {
    var input = input
    var c = false
    var remove: [Int] = []
    while true {
        c = false
        var index = 0
        let end = input.count - 2
        while true {
            if input[index].reactsWith(input[index+1]) {
                remove.append(index)
                remove.append(index + 1)
                c = true
                index += 2
            }
            else {
                index += 1
            }
            if index >= end {
                break
            }
        }

        for i in remove.sorted().reversed() {
            input.remove(at: i)
        }
        remove.removeAll()

        if !c {
            break
        }
    }

    return input.count
}

func partOne() {
    print("Part 1 answer is :\(polymer(input))")
}

func partTwo() {
    let all = Set<String.Element>(Array(input1.lowercased()))
    var result: [Int] = []
    for char in all {
        let filterd = input.filter { $0 != char && $0.reactsWith(char) == false }
        result.append(polymer(filterd))
    }

    print("Part 2 answer is: \(result.min()!)")
}

partOne()
partTwo()
